/
DROP TABLE useri cascade constraints
/
DROP TABLE carti_imprumutate cascade constraints
/
DROP TABLE autori cascade constraints
/
DROP TABLE domenii cascade constraints
/
DROP TABLE pareri cascade constraints
/

create table carti(
id_carte number(5) primary key not null,
titlu_carte varchar2(50) not null,
id_autor number(5),
editura varchar2(20),
id_domeniu number(5),
an_aparitie number(5),
id_raft number(5),
nr_exemplare number(5),
disponibilitate varchar2(20)
)
/

create table useri(
id_user number(5) primary key not null,
nume varchar2(20) not null,
prenume varchar2(20) not null,
profesie varchar2(20),
adresa varchar2(50),
parola varchar(20),
nr_carti_imprumutate number(5),
nr_carti_citite number(5)
)
/

create table carti_imprumutate(
id_user number(5),
id_carte number(5),
data_imprumut date,
data_restituire date,
primary key(id_user,id_carte)
)
/

create table autori(
id_autor number(5) primary key not null,
nume varchar2(20) not null,
prenume varchar2(20) not null,
data_nastere date,
data_deces date
)
/

create table domenii(
id_domeniu number(5) primary key not null,
descriere varchar2(20)
)
/

create table pareri(
id_carte number(5) not null,
id_user number(5) not null,
parere varchar(100)
)
/


alter table carti add foreign key(id_autor) references autori(id_autor);
alter table carti add foreign key(id_domeniu) references domenii(id_domeniu);
alter table carti_imprumutate add foreign key(id_user) references useri(id_user);
alter table carti_imprumutate add foreign key(id_carte) references carti(id_carte);
alter table pareri add foreign key(id_carte) references carti(id_carte);
alter table pareri add foreign key(id_user) references useri(id_user);


